import React from "react";
import buggati from "../../images/bugatti4.webp";

function Profile() {
  const handleLogout = () => {
    // Implement your logout logic here
    console.log("User logged out");
  };

  return (
    <div className="d-flex justify-content-center align-items-center h-100">
      <div className="card" style={{ width: "25rem" }}>
        <div className="card-body d-flex flex-column justify-content-start align-items-center">
          <img src={buggati} alt="..." className="card-img-top" />
          <h3 className="card-title mb-1">steve-nene</h3>
          <h6 className="text mb-3">Stevekid705@gmail.com</h6>
          <p className="card-text mb-4">This is a buggati and dont worry much</p>
          <button type="button" className="btn btn-outline-danger" onClick={handleLogout}>
            Logout
          </button>
        </div>
      </div>
    </div>
  );
}

export default Profile;
